        public string[] GetJsonStuff()
        {
            List<string> stuff = new List<string>();

            JToken ret = JToken.Parse(calendarData);
            int code = ret["meta"]["code"].Value<int>();
            if (code != 200)
            {
                return null;
            }

            JToken holidays = ret["response"]["holidays"];

            if (holidays.Value<JArray>().Count > 0)
            {
                foreach (var holiday in holidays)
                {
                    string name = holiday["name"].Value<string>();
                    string type = holiday["type"][0].Value<string>();

                    JToken datetime = holiday["date"]["datetime"];

                    int year = datetime["year"].Value<int>();
                    int month = datetime["month"].Value<int>();
                    int day = datetime["day"].Value<int>();

                    DateTime dt = DateTime.Parse($"{month}/{day}/{year}");

                    stuff.Add($"{name},{type},{dt:g}");
                }
            }

            return stuff.ToArray();

        }
    }
